import { StyleSheet } from "react-native";
import { transparent } from "react-native-paper/lib/typescript/styles/colors";

export const loginStyle = StyleSheet.create({
    content: {
        display: "flex",
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        flexDirection: 'row',
        backgroundColor: "#FFB6C1",

    },
    View: {
        width: "80%",
        shadowRadius: 15,

    },
    couleurDeCase: {
        color: transparent
    }

})
